import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
//import Editor from './Editor';
//import List from '@material-ui/core/List';
//import ListItem from '@material-ui/core/ListItem';
//import ListItemText from '@material-ui/core/ListItemText';
//import ListSubheader from '@material-ui/core/ListSubheader';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
//import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles(theme => ({
    button: {
      margin: theme.spacing(1),
    },
    input: {
      display: 'none',
    },
  }));
let id = 0;
const classes = useStyles();
/*
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}
*/
function TabContainer(props) {
    return (
        <Paper style={{overflow: 'auto'}}>
          <Table >
            <TableHead>
              <TableRow>
                <TableCell align="right">PID</TableCell>
                <TableCell align="right">USUARIO</TableCell>
                <TableCell align="right">ESTADO</TableCell>
                <TableCell align="right">RAM%</TableCell>
                <TableCell align="right">NOMBRE</TableCell>
                <TableCell align="right">Opcions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
            {props.data.map(row => (
                <TableRow key={row.Pid}>

                  <TableCell align="right">{row.Pid}</TableCell>
                  <TableCell align="right">{row.User}</TableCell>
                  <TableCell align="right">{row.Estado}</TableCell>
                  <TableCell align="right">{row.Memoria}</TableCell>
                  <TableCell align="right">{row.Nombre}</TableCell>
                  <TableCell align="right">
                    <Button variant="contained" color="secondary" className={classes.button}>
                        Secondary
                    </Button>
                  </TableCell>

                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Paper>
      );
}
export default class Body extends Component {

  state = {
      value: 0,
      labels: ['January', 'February', 'March',
           'April', 'May'],
  datasets: [
    {
      label: 'Rainfall',
      fill: false,
      lineTension: 0.5,
      backgroundColor: 'rgba(75,192,192,1)',
      borderColor: 'rgba(0,0,0,1)',
      borderWidth: 2,
      data: [65, 59, 80, 81, 56]
    }
  ]
  };

  constructor(props){
      super(props);
      this.titulos = ['Principal','CPU','RAM']
      console.log("Constructor del Footer");
     console.log(this.props.data);

  }
  handleChange = (event, value) => {
      this.setState({ value });
    };
  handlecodeChange = (code)=>{
      console.log('desde Footer:: '+code);
  }
    render() {

      const { value } = this.state;

      return (
        <Paper >

            <Tabs
              value={value}
              onChange={this.handleChange}
              indicatorColor="primary"
              textColor="primary"
              variant="scrollable"
              scrollButtons="auto"
              centered
            >
              {<Tab label={this.titulos[0]} />}
              {<Tab label={this.titulos[1]} />}
              {<Tab label={this.titulos[2]} />}
              {<Tab label={this.titulos[3]} />}

            </Tabs>

          {value === 0 && <TabContainer flag={0} data={this.props.data}></TabContainer>}
          {value === 1 && <TabContainer flag={1} data={this.props.data}></TabContainer>}
          {value === 2 && <TabContainer flag={2} data={this.props.data}></TabContainer>}


          </Paper >
      );
    }


}
